.
.
To the goodness in life
On an otherwise gloomy day, this little niece beams with over the board laughter and joy. The best conversation that sister and I have about her is her understanding of not understanding anything that is being told to her. The ability to laugh at any scolding and living a life thats innocent and simple. Because her world is perfect according to her. 
.
.
Dear baby, I pray and hope that you never loose this ability. Retain that laughter and the sense to secure your sanity. Because the world is full of people after you for a piece of your mind. But the truth will be , a Master piece is the one who has Mastered peace.  And we learn this from you. Thank you baby teacher. 
.
.
Next is the husband. On the lines of peace since thats what came up. A usual me keeps complaining of getting stretched from all directions. And while he doesnt believe in "philosophy" , I said - No one lets me be at ease. He - You be easy. Ease will come . 
It meant SO MUCH. How he tries to imbibe his sense of patience and ease (with not much success always lol). And the gaps that are left, he tries to fill with these well thought customised birthday gifts. 50plant seeds. A customised diary since I love to write. A customised bottle to take care of my water needs. A pair of bluetooth speaker because my work demands it. And a customised apron . 
.
.
Life might not be simple always. But its beautiful nevertheless. Count your blessings. 
.
.
